n	// For some reason, factor0 is set to 0.0f while factor1 is set to 1.0f/lightrange (on both D3D and OpenGL)\n	// This'll result in no visible falloff as 1.0f / (d / lightrange) will always be larger than 1.0f (if the vertex is within range)\n	\n		atten = 1.0 / (veclen / posrange.w);\n		if (veclen > posrange.w)\n		{\n			atten = 0.0;\n		}	\n#else\n		atten = clamp( (1.0 - (veclen / posrange.w)), 0.0, 1.0);		// storing 1.0f/range instead would save a rcp\n#endif\n	}\n	float dotresult = dot(ws_normal, diffvec);\n	dotresult = max(0.0, dotresult);\n\n	return dotresult * atten * diffusecol;\n}\n\nvec4 DoLighting(vec4 vertexcolour, vec4 objectspacepos, vec3 objectspacenormal)\n{\n	if (gm_LightingEnabled)\n	{\n		// Normally we'd have the light positions\\directions back-transformed from world to object space\n		// But to keep things simple for the moment we'll just transform the normal to world space\n		vec4 objectspacenormal4 = vec4(objectspacenormal, 0.0);\n		vec3 ws_normal;\n		ws_normal = (gm_Matrices[MATRIX_WORLD] * objectspacenormal4).xyz;\n		ws_normal = normalize(ws_normal);\n\n		vec3 ws_pos;\n		ws_pos = (gm_Matrices[MATRIX_WORLD] * objectspacepos).xyz;\n\n		// Accumulate lighting from different light types\n		vec4 accumcol = vec4(0.0, 0.0, 0.0, 0.0);		\n		for(int i = 0; i < MAX_VS_LIGHTS; i++)\n		{\n			accumcol += DoDirLight(ws_normal, gm_Lights_Direction[i], gm_Lights_Colour[i]);\n		}\n\n		for(int i = 0; i < MAX_VS_LIGHTS; i++)\n		{\n			accumcol += DoPointLight(ws_pos, ws_normal, gm_Lights_PosRange[i], gm_Lights_Colour[i]);\n		}\n\n		accumcol *= vertexcolour;\n		accumcol += gm_AmbientColour;\n		accumcol = min(vec4(1.0, 1.0, 1.0, 1.0), accumcol);\n		accumcol.a = vertexcolour.a;\n		return accumcol;\n	}\n	else\n	{\n		return vertexcolour;\n	}\n}\n\n#define _YY_GLSLES_ 1\n/*\n	'Linear Blur' by Xor\n	\n	A generic vertex passthrough shader.\n*/\nattribute vec3 in_Position;\nattribute vec4 in_Colour;\nattribute vec2 in_TextureCoord;\n\nvarying vec2 v_vTexcoord;\nvarying vec4 v_vColour;\n\nvoid main()\n{\n    gl_Position = gm_Matrices[MATRIX_WORLD_VIEW_PROJECTION] * vec4(in_Position.xy, 0.0, 1.0);\n    \n    v_vColour = in_Colour;\n    v_vTexcoord = in_TextureCoord;\n}\n",
Fragment:"precision mediump float;\n#define LOWPREC lowp\n// Uniforms look like they're shared between vertex and fragment shaders in GLSL, so we have to be careful to avoid name clashes\n\nuniform sampler2D gm_BaseTexture;\n\nuniform bool gm_PS_FogEnabled;\nuniform vec4 gm_FogColour;\nuniform bool gm_AlphaTestEnabled;\nuniform float gm_AlphaRefValue;\n\nvoid DoAlphaTest(vec4 SrcColour)\n{\n	if (gm_AlphaTestEnabled)\n	{\n		if (SrcColour.a <= gm_AlphaRefValue)\n		{\n			discard;\n		}\n	}\n}\n\nvoid DoFog(inout vec4 SrcColour, float fogval)\n{\n	if (gm_PS_FogEnabled)\n	{\n		SrcColour = mix(SrcColour, gm_FogColour, clamp(fogval, 0.0, 1.0)); \n	}\n}\n\n#define _YY_GLSLES_ 1\n/*\n	'Linear Blur' by Xor\n\n	Samples the texture evenly in a straight line.\n	The noise texture is used to offset the samples.\n*/\n\nvarying vec2 v_vTexcoord;\nvarying vec4 v_vColour;\n\n//Get surface texel size for sample direction\nuniform vec2 gm_pSurfaceTexelSize;\n//Get surface dimensions for pixel coordinates\nuniform vec2 gm_pSurfaceDimensions;\n\n//Blur vector in pixels\nuniform vec2 g_LinearBlurVector;\n\n//Blur noise texture for sample offsets\nuniform sampler2D g_NoiseTexture;\n//Blur noise texel size\nuniform vec2 g_NoiseTextureTexelSize;\n\n//Amount of fading at the edges\n#define FADE 0.5\n//Number of texture samples\n#define SAMPLES 64\n//Step size (half the reciprocal of SAMPLES).\n//Example: 0.5 / 64 = 0.03125\n#define STEP_SIZE 0.03125\n\nvoid main()\n{\n	//Samples total for averaging\n	vec4 samples_total = vec4(0.0, 0.0, 0.0, 0.0);\n	//Total weight for divisor\n	float weights_total = 0.0;\n\n\n	//Compute pixel coordinates from texture coordinates\n	vec2 pixel_coord = v_vTexcoord * gm_pSurfaceDimensions;\n	//Compute noise texture coordinates from view-space pixels\n	vec2 noise_texcoord = pixel_coord * g_NoiseTextureTexelSize;\n	//Sample noise for offsets\n	float noise = texture2D(g_NoiseTexture, noise_texcoord).r;\n	//Sample position starting at -1.0 plus random offset\n	float pos = -1.0 + STEP_SIZE * noise;\n	//Compute texture-space vector\n	vec2 vect = g_LinearBlurVector * gm_pSurfaceTexelSize;\n\n	//Sample in line\n	for(int i = 0; i < SAMPLES; i++)\n	{\n		//Compute sampple texture coordinates\n		vec2 sample_texcoord = v_vTexcoord + vect * pos;\n		//Get texture sample\n		vec4 sample = texture2D(gm_BaseTexture, sample_texcoord);\n		//Compute weight with parabola falloff\n		float weight = 1.0 - pos * pos * FADE;\n\n		//Add to totals\n		samples_total += sample * weight;\n		weights_total += weight;\n		//Step along the line\n		pos += STEP_SIZE;\n	}\n	//Compute weighted average\n	vec4 blur_colour = samples_total / weights_total;\n	//Output with vertex colour\n	gl_FragColor = v_vColour * blur_colour;\n}\n",
